import axios from "axios";

export const fetchFromServer = async (url, method, data) => {
    let response;

    try {
        response = await axios({
            url: url,
            method: method,
            data: {
                query: data
            }
        })

        return response;

    } catch(err) {
        console.log(err);
    }
}
